objArrDeduplication(objArr,objKey) {
    let obj = {},resultArr = []
    resultArr = objArr.reduce (function(item,next){
        obj[next[objKey]] ? '' : obj[next[objKey]]  = true && item.push(next)
        return item;
    },[])
    return resultArr;
}

