*{
    box-sizing: border-box;
    padding:0;
    margin:0;
}
body {
    background-color: #21222e;
}
.timelineBox-wrap{
    width:80%;
    margin:0 auto;
    padding:20px;
}
.timelineBox {
    position: relative;
    .timeline {
        width: 100%;
        height: 2px;
        background-color: #34475f;
        position: relative;
        padding: 0 15px 0 10px;
        display: flex;
        justify-content: space-around;
        align-items: center;
        z-index: 10;
        &::after {
            content: '';
            width: 0;
            height: 0;
            border-color: transparent transparent #33455c #33455c;
            border-style: solid;
            border-width: 5px 10px;
            position: absolute;
            right: 1px;
            bottom: 2px;
        }
    }
    .list {
        width: 110px;
        display: flex;
        flex-direction: column;
        align-items: center;
        position: relative;
        .listItem {
            width: 100%;
            line-height: 1.5;
            border-radius: 4px;
            background-color: rgba(0, 145, 230, 0.5);
            border: 1px solid #476b8f;
            color: #ffffff;
            font-size: 13px;
            text-align: center;
            padding: 0 5px;
        }
        &:before {
            content: '';
            width: 1px;
            height: 44px;
            background-color: #33455c;
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
        }
    }
    .timePoint {
        width: 8px;
        height: auto;
        position: relative;

        .point {
            width: 8px;
            height: 8px;
            border-radius: 50%;
            background-color: #d89931;
            position: absolute;
            left: 50%;
            top: 50%;
            transform: translateX(-50%) translateY(-50%);
        }
        &.special {
            .point {
                width: 12px;
                height: 12px;
                background-color: #ff4f12;
            }
        }
        .yearlabel {
            position: absolute;
            color: #c5c7cc;
            font-size: 12px;
            top: 15px;
            left: 50%;
            transform: translateX(-50%);
        }
        &:nth-child(2n) {
            .yearlabel {
                top: -25px;
            }
        }
    }
    .timeline-up,
    .timeline-down {
        padding: 0 15px 0 10px;
        display: flex;
        justify-content: space-around;

        .timePoint {
            display: flex;
            justify-content: center;
            .listItem {
                width: 110px;
                max-width: 180px;
                display: flex;
                align-items: center;
                justify-content: center;
            }
        }
    }
    .timeline-up {
        padding-bottom: 44px;
        .list {
            flex-direction: column-reverse;
            .listItem {
                margin-top: 8px;
            }
            &:before {
                bottom: -44px;
            }
        }
    }
    .timeline-down {
        padding-top: 44px;
        .list {
            .listItem {
                margin-bottom: 8px;
            }
            &:before {
                top: -44px;
                z-index: 0;
            }
        }
    }
}



